// Inside Dashboard.js
import React from 'react';
import { View, Text } from 'react-native';

const Dashboard = ({ username }) => {
    return (
        <View>
            <Text>Welcome, {username}!</Text>
            {/* Your dashboard content */}
        </View>
    );
};

export default Dashboard;
